import './App.css';
import {Container} from 'react-bootstrap'
import { Title } from './components/Title';
import 'bootstrap/dist/css/bootstrap.min.css';
import { SearchForm } from './components/searchForm';

function App() {
  return (
    <div className="wrapper">
      <Container>
       <Title/>
       <SearchForm/>
      </Container>

    </div>
  );
}

export default App;
